  - - 1
    - about
    - About
    - "I'm a web developer and photographer in Plymouth, UK. I love taking pictures
      of just about anything, particularly landscapes and anything that creates a
      strong graphic image.\r\n\r\nTaking the shot is often only half the work, and
      I've got no problem with manipulating my images to either get closer to what
      my eye saw at that moment, or to create something quite different.\r\n\r\nI
      always appreciate constructive criticism of my work, so please have a look around
      and feel free to [drop me a line](/contacts/new)."
    - '2010-10-12 17:14:14.120388'
    - '2013-02-14 21:49:52.321285'

